import React, { Component, Fragment } from 'react';
import { FlatList, View, Text } from 'react-native';

// Components
import Home from './components/Home';
import About from './components/About';
import Profile from './components/Profile';

// Navigation
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

import { AntDesign } from '@expo/vector-icons';
import { colors } from './styles';

const Tab = createBottomTabNavigator();

export class App extends Component {
	render() {
		return (
			<NavigationContainer>
				<Tab.Navigator
					initialRouteName="Home"
					tabBarOptions={{ activeTintColor: colors.mainColor, style: { paddingTop: 100 } }}
				>
					<Tab.Screen
						options={{
							title: 'پروفایل',
							tabBarIcon: ({ color, size }) => <AntDesign name="user" size={size} color={color} />
						}}
						component={Profile}
						name="Profile"
					/>
					<Tab.Screen
						options={{
							title: 'علاقه مندی ها',
							tabBarIcon: ({ color, size }) => <AntDesign name="hearto" size={size} color={color} />
						}}
						component={Home}
						name="Favourites"
					/>
					<Tab.Screen
						options={{
							title: 'سبد خرید',
							tabBarIcon: ({ color, size }) => <AntDesign name="shoppingcart" size={size} color={color} />
						}}
						component={Home}
						name="Cart"
					/>
					<Tab.Screen
						options={{
							title: 'جستجو و دسته بندی',
							tabBarIcon: ({ color, size }) => <AntDesign name="search1" size={size} color={color} />
						}}
						component={Home}
						name="Search"
					/>
					<Tab.Screen
						options={{
							title: 'خانه',
							tabBarIcon: ({ color, size }) => <AntDesign name="home" size={size} color={color} />
						}}
						component={Home}
						name="Home"
					/>
				</Tab.Navigator>
			</NavigationContainer>
		);
	}
}

export default App;
